function Test2(props){
   return(
       <div style={{backgroundColor:"yellowgreen", width:"600px", height:"300px",textAlign:"center", borderRadius:"50px"}} >
          
           <h1>Name={props.data}  </h1>
         <h3><p>DOB={props.fo}</p></h3>  
       </div>
   )
}
export default Test2;
